  \"2013-03-15T22:50:32.036228\",\n\t\"name\": \"arizona-volcanic-vents\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a compilation of volcanic
  vent features compiled by the Arizona Geological Survey, published as a Web feature
  service, a Web map service, an ESRI service and as an Excel spreadsheet for the
  National Geothermal Data System. The spreadsheet contains 7 worksheets, including
  information about the template, notes related to revisions of the template, Resource
  provider information, the data, a field list (data mapping view) and a worksheet
  with vocabularies for use in populating the spreadsheet (data valid terms). Data
  from 23 volcanic features are included. Fields in the data table include FeatureURI,
  VolcanicGroup, VolcVentName, MapLabel, Description, FeatureType, UTM_N, UTM_E, UTMDatumZone,
  LatDegree, LongDegree, SRS, LocationUncertaintyStatement, County, State, LocationKeyword,
  VentElevation, ElevationUOM, RelatedFeature, GeologicHistory, YoungestAge, OldestAge
  YoungestRadiometricAge_Ma, OldestRadiometricAge_Ma, AgeUncertainty_Ma, AgeSource,
  GeologicUnit, MaterialComposition, FlowType, Notes and Source.\",\n\t\"license_title\":
